import React from 'react';
import '../css/Navbar.css';

const Navbar = () => {
    return (
        <nav className="navbar">
            <div className="navbar-container">
                <div className="navbar-h">
                    <a href="/">Home Page</a>
                </div>
               
            </div>
        </nav>
    );
};

export default Navbar;
